import React from "react";
import slider1 from "./../../assets/images/slider1.jpg";
import slider2 from "./../../assets/images/slider2.jpg";
import slider3 from "./../../assets/images/slider3.jpg";
import slider4 from "./../../assets/images/slider4.jpg";
import slider5 from "./../../assets/images/slider5.jpg";

function MainSlider() {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };

  return (
    <div className="row g-0">
      <div className="col-md-9">
      <Slider {...settings}>
          <div>
            <h3>1</h3>
          </div>
          <div>
            <h3>2</h3>
          </div>
          <div>
            <h3>3</h3>
          </div>
          <div>
            <h3>4</h3>
          </div>
          <div>
            <h3>5</h3>
          </div>
          <div>
            <h3>6</h3>
          </div>
        </Slider>
        <img src={slider1} width={279}  height={388} className="w-100 text-center" alt="" />
      </div>
      <div className="col-md-3">
      <img src={slider2} width={279}height={224}className="" alt="" />
      <img src={slider3}  width={279}height={224}className="" alt="" />
      </div>
    </div>
  );
}

export default MainSlider;
